import './App.css'
import Login from './Components/Login/Login';
import Dashboard from './Components/Dashboard/Dashboard';
import { Routes, Route } from 'react-router-dom'


function App() {

  return (
    <div >

      <Routes>
        <Route path="/login" element={<Login/>} />
        <Route exact path="/" element={<Dashboard />} />
      </Routes>
    </div>
  );
}

export default App;
